const {ccclass, property} = cc._decorator;

@ccclass
export class FBUtil extends cc.Component {
    static ad:any = null;//��Ž������
    static interstitialAd:any = null;//��Ų������
    public static adVedio: any = null;
    static shareImageString = "data:image/jpeg;base64,";
    public static getID():string
    {
        if(typeof(FBInstant) === "undefined")
            return null;
        return FBInstant.player.getID();
    }

    public static getContextID():string
    {
        if(typeof(FBInstant) === "undefined")
            return null;
        return FBInstant.context.getID();
    }

    public static getPlayerName():string
    {
        if(typeof(FBInstant) === "undefined")
            return null;
        return FBInstant.player.getName();
    }

    public static getMyPhoto():string
    {
        if(typeof(FBInstant) === "undefined")
            return null;
        return FBInstant.player.getPhoto();//���ص���һ��url��ַ
    }

    public static getSupportAPI()
    {
        let support = FBInstant.getSupportedAPIs();
        //console.log(support);
    }

    public static setScoreAsync(rankName:string, val:number, exData:string, tar:any, cb:Function):void
    {
        if(typeof(FBInstant) === "undefined")
            return;
        FBInstant.getLeaderboardAsync(rankName)
        .then(function(leaderboard){
            return leaderboard.setScoreAsync(val, exData);
        })
        .then(function(entry){
            cb.apply(tar, [true]);
        })
    }

    public static getPlayerEntryAsync(rankName:string, tag:any, cb:Function):void
    {
        if(typeof(FBInstant) === "undefined")
            return;

        FBInstant
        .getLeaderboardAsync(rankName)
        .then(leaderboard => leaderboard.getPlayerEntryAsync())
        .then(entry =>{
            console.log(
                entry.getRank() + "." +
                entry.getPlayer().getName() + ": " +
                entry.getScore()
            );
            cb.apply(tag, [entry]);
        }).catch(error => console.error(error));
    }

    public static getEntriesAsync(rankName: string, num: number, start: number, tag: any, cb: Function): void
    {
        if(typeof(FBInstant) === "undefined") return;

        FBInstant
        .getLeaderboardAsync(rankName)
        .then(leaderboard => leaderboard.getEntriesAsync(num, start))
        .then(entries => {
            for (var i = 0; i < entries.length; i++) {
            console.log(
                entries[i].getRank() + '. ' +
                entries[i].getPlayer().getName() + ': ' +
                entries[i].getScore()
            );
            }
            cb.apply(tag,[entries]);
        }).catch(error => console.error(error));
    }

    public static share(caller:any):void
    {
        if(typeof FBInstant === "undefined")
            return;
        let name:string = FBInstant.player.getName();
        let conId = FBInstant.context.getID();
        let photo = FBInstant.player.getPhoto();
        let playerId = FBInstant.player.getID();
        let json = {conId:conId, name:name, photoUrl:photo, playerId:playerId};
        FBInstant.shareAsync({
            intent: 'SHARE',
            image: FBUtil.getColorShareImg(),
            text: name + "Join us!",
            data: {myReplayData: JSON.stringify(json)},
        }).then(() => {
            if(caller && caller.shareBack){
                caller.shareBack(true);
            }
        }).catch((e) =>{
            console.log(e);
        });
    }

    public static getColorShareImg()
    {
        return this.shareImageString;
    }

    public static getConnectedPlayersAsync(tar:any, cb:Function):void
    {
        if(typeof FBInstant === 'undefined')
            return;
        let connectPlayers = FBInstant.player.getConnectedPlayersAsync()
        .then(function(players){
            cb.apply(tar, [players]);
        })
    }

    public static chooseAsync()//�������
    {
        if(typeof FBInstant === 'undefined')
            return;
        FBInstant.context.chooseAsync({
            filters: ['NEW_CONTEXT_ONLY'],
            minSize: 2,
        }).then(function(){
            let name:string = FBInstant.player.getName();
            let conId = FBInstant.context.getID();
            let photo = FBInstant.player.getPhoto();
            let json = {conId:conId, name:name, photoUrl:photo};
            FBUtil.updateAsync(JSON.stringify(json), "Check out your friends' rankings! See if you can be one of them!");
        }).catch((err) =>{
            console.log("chooseAsync failure!!!!");
            console.log(err);
        });
    }
    public static updateAsync(data:string, tip:string = ""):void
    {
        if(typeof FBInstant === "undefined") return;

        FBInstant.updateAsync({
            action: 'CUSTOM',
            cta: 'Join The Fight',
            image: FBUtil.getColorShareImg(),
            text: {
                default: tip,
                localizations: {
                    ar_AR: tip,
                    en_US: tip,
                    es_LA: tip,
                    zh_CN: tip,
                }
            },
            template: 'VILIAGE_INVASION',
            data: {myReplayData: data},
            strategy: 'IMMEDIATE',
            notification: 'NO_PUSH',
        }).then(function(){
            console.log("updateAsync success");
        }).catch((err)=>{
            console.log("updateAsync failure!!!");
            console.log(err);
        });
    }

    public static loadAsync(tar: any = null, call: Function = null, isWhow: boolean = false): void {
        if (typeof FBInstant === 'undefined') return;

        let ad = null;
        FBInstant.getRewardedVideoAsync(
            '317690985816985_331903421062408',
        ).then(function(rewardedVideo) {
            ad = rewardedVideo;
            console.log("getRewardedVideoAsync succ")
            return ad.loadAsync();
        }).then(function() {
            // Ad loaded
            console.log("loadAsync succ")
            FBUtil.adVedio = ad;
            if(isWhow) {
                FBUtil.showAsync(tar, call);
            }
        }).catch((err) => {
            console.log("showAsync error!");
            console.log(err);
            if(tar && call) {
                call.apply(tar, [false]);
            }
            FBUtil.adVedio = null;
        });
    }

    public static showAsync(tar: any = null, call: Function = null): void {
        if (typeof FBInstant === 'undefined') return;

        if(!FBUtil.adVedio) {
            console.log("load ad again");
            FBUtil.loadAsync(tar, call, true);
            return;
        }
        
        FBUtil.adVedio.showAsync().then(function() {
            // Ad watched
            console.log("Ad watched !");
            
            FBUtil.adVedio = null;
            if(tar && call) {
                call.apply(tar, [true]);
            }
            FBUtil.loadAsync(null, null, false);
        }).catch((err) => {
            console.log("showAsync error!");
            console.log(err);
            if(tar && call) {
                call.apply(tar, [false]);
            }
            FBUtil.adVedio = null;
        });
    }

    public static preloadInterstitialAd():void
    {
        if(typeof(FBInstant) === "undefined")
            return;
        var ad = null;
        FBInstant.getInterstitialAdAsync(
            '317690985816985_331904737728943',
        ).then(function(interstitial){
            console.log("load ad begin");
            FBUtil.interstitialAd = interstitial;//��ȡ�������
            return FBUtil.interstitialAd.loadAsync();
        }).then(function(){
            console.log("preloadAd ok");
        }).catch(function(e){
            cc.error(e);
        });        
    }
    
    public static showInterstitialAd(caller:any, cb: Function):void
    {
        if(typeof(FBInstant) === "undefined")
            return;

        if(!FBUtil.interstitialAd)//û�м��ع��
        {   
            FBUtil.preloadInterstitialAd();
            FBUtil.interstitialAd.showAsync()
            .then(function(){
                cb.apply(caller, [true]);
                FBUtil.preloadInterstitialAd();
            }).catch(function(e){
                cc.error(e);
                cb.apply.apply(caller, [false]);
                FBUtil.preloadInterstitialAd();
            })
        }
        else
        {
            FBUtil.interstitialAd.showAsync()
            .then(function(){
                cb.apply(caller, [true]);
                FBUtil.preloadInterstitialAd();
            }).catch(function(e){
                cc.error(e);
                cb.apply.apply(caller, [false]);
                FBUtil.preloadInterstitialAd();
            })
        }
    }

    start () {

    }

    // update (dt) {}
}
